        .header {
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 35px;
            background-color: hsla(14, 45%, 36%, 0.8);
            width: 100%; /* Ensure it stretches across the page */
            box-sizing: border-box; /* Includes border in width calculation */
            margin: 0; /* Removes any margin */
            border-radius: 0; /* Removes rounded corners */
        }

        .recipe-container {
            border: 1px solid #ccc;
            box-shadow: 2px 2px 10px rgba(0, 0, 0, 0.1);
            border-radius: 8px;
            margin: 20px auto;
            max-width: 800px;
            background: #ffffff;
            padding: 20px;
            border-radius: 8px;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
            background-color: #fee0c4ff;
        }

        h1 {
            text-align: center;
            margin: 0;
            color: #f6efebff;
        }

        h2 {
            margin: 25px;
            color: hsl(14, 45%, 36%);
            text-align: center;
        }

        h3 {
            text-align: center;
            margin: 0;
            color: hsl(14, 45%, 36%);
        }

        .ingredients, .instructions {
            margin-bottom: 20px;
            margin: 20px;
        }

        .ingredients ul {
            list-style-type: disc;
            margin-left: 20px;
        }

        .back-btn {
            display: inline-block;
            padding: 10px 15px;
            background-color: hsl(14, 45%, 36%);
            color: white;
            border-radius: 5px;
            text-decoration: none;
            font-size: 16px;
            text-align: center;
        }

        .back-btn:hover {
            background-color: hsl(14, 46%, 25%);
        }

        .instructions {
    text-align: center; /* Centers any inline or inline-block element inside this container */
    margin-top: 20px; /* Adds spacing above the button */
}
.center-container {
    text-align: center; /* Centers any inline or inline-block element inside this container */
    margin-top: 20px; /* Adds spacing above the button */
}
    </style>
</head>
<body>
    <div class="header">
        <h1>Meal Plan App</h1>
    </div>
    <h2>{{ food['Title'] }}</h2>

    <div class="recipe-container">
        <div class="ingredients">
            <h2>Ingredients</h2>
            <ul>
                {% for ingredient in food['Cleaned_Ingredients'].split(', ') %}
                <li>{{ ingredient }}</li>
                {% endfor %}
            </ul>
        </div>

        <div class="instructions">
            <h2>Instructions</h2>
            <p>{{ food['Instructions'] }}</p>
        </div>

        <div class="center-container">
            <a href="/" class="back-btn">Back to Home</a>
        </div>
    </div>
</body>
</html>
